    return THREEBOX.init();
  };

  const valueB = (B) => {
    return THREEBOX.init();
  };

  const valueC = (C) => {
    return THREEBOX.init();
  };
  // showShape
  const showShape = () => {
    return THREEBOX.main();
  };

  return (
    <fragment>
      {showShape()}
      <Menu clb={closeBox} opb={openBox} />
    </fragment>
  );
};

export default Control;
